import React from 'react';
import '../CSS/Box.css';
import Logotipo from '../img/logotipo.jpg'

function Corpo() {
    return (
        <main>
            <div className='box'>
                <img src={Logotipo} />
            </div>
        </main>
    )
}

export default Corpo;
